import React from "react";
import Navbar from "../navbar/Navbar"
import Privacy from "../privacy/Privacy"
import Footer from '../footer/Footer';
import Copyright from '../copyright/Copyright';




const PrivacygPage = () => {
    return (
        <>
            <Navbar/>
            <Privacy/>
            <Footer/>
            <Copyright/>
  
        </>
    )
}

export default PrivacygPage;
